import React from "react";

function Header() {
    return (
        <nav className="navbar shadow-md">
        <ul className="flex bg-amber-200 p-5 gap-10 justify-start pr-10 font-bold items-center">
            <li className="pr-10 text-3xl font-black">VandyBox</li>
            <li className=""><a href="">Home</a></li>
            <li className=""><a href="">Favorites</a></li>
            <li className=""><a href="">Categories</a></li>
            <li className=""><a href="">Rankings</a></li>
            <li className="ml-auto"><a href=""><img className="bg-red-300 w-10 h-10"></img></a></li>
        </ul>
        </nav>
    )
}

export default Header
